import React from 'react';
import { Link } from 'react-router-dom';
import '../css/NavDiscover.css';

export default function NavDiscover() {
    return (
        <div className='container' style={{margin:'2rem'}}>
        <div className='row' style={{marginTop:'3vh'}}>
            <div className='col-xl-3 col-md-12'>
        <div className='nav-discover'>
            <Link to='discoverfr/engagements'><h1>ENGAGEMENTS</h1></Link>
            <Link to='discoverfr/knowledge'><h1>SAVOIR-FAIRE</h1></Link>
            <Link to='discoverfr/charte'><h1>CHARTE DE DEVELOPPEMENT DURABLE</h1></Link>
            </div>
        </div>
        <div className='col-xl-9' style={{marginTop:'2vh'}}>
        Être à la pointe de la technologie et à l’écoute des besoins de notre clientèle nécessite un développement continu.      
        5àsec évolue au fil des années pour mieux vous satisfaire mais ne déroge pas à ses 5 engagements afin de vous garantir une qualité de service durable. 
        </div>
        </div>
        </div>
    )
}
